import React, { useState } from 'react'
import './ChooseType.css'


export default function ChooseType({ setTodos, todos }) {

  const [editMode, setEditMode] = useState(false)


  function Removed() {

    setTodos(todos.filter((todo) => todo.id === Number))

  }


  return (
    <div>
      <div className='dots' onClick={() => setEditMode(!editMode)}>
        <div className={editMode ? "dots_box" : "dots_box1"}>
          <div className='dot'></div>
          <div className='dot'></div>
          <div className='dot'></div>
        </div>
      </div>
      {
        editMode &&
        <div>
          <div className='comands'>
            <div className='command_box'>
              <div><NavLink to='/completed' element={<div>Completed</div>}/></div>
              <span />
              <div><NavLink to='/completed' element={<div>in Progress</div>}/></div>
              <span />
              <div onClick={Removed}><NavLink to='/completed' element={<div onClick={Removed}>Removed</div>}/></div>
            </div>
          </div>
        </div>
      }
    </div>
  )
}




